mt.__index =    function (table, key)
                return table[t_DB[key]]
            end

function getDataById(key_id)
    local id_data = ItemConfig[key_id]

    if id_data == nil then
        return nil
    end
    if getmetatable(id_data) ~= nil then
        return id_data
    end
    setmetatable(id_data, mt)
    return id_data
end

function getArrDataByField(fieldName, fieldValue)
    local arrData = {}
    for k, v in pairs(ItemConfig) do
        if getmetatable(v) == nil then
            setmetatable(v, mt)
        end
        if v[fieldName] == fieldValue then
            arrData[#arrData+1] = v
        end
    end

    return arrData
end

function release()
    _G["DB_ItemConfig"] = nil
    package.loaded["DB_ItemConfig"] = nil
    package.loaded["DBSystem/DB_ItemConfig"] = nil
end
